package javabean;

public class BeanTest {
	private String a;
	private String b;
	public BeanTest() {
		this.a=null;
		this.b=null;
	}
	public BeanTest (String a, String b) {
		// TODO Auto-generated constructor stub
		this.a=a;
		this.b=b;
	}
	public String getA() {
		return a;
	}
	public void setA(String a) {
		this.a = a;
	}
	public String getB() {
		return b;
	}
	public void setB(String b) {
		this.b = b;
	}
	
	
	

}
